const components=document.querySelectorAll('[data-carousell="component"]');components.forEach(e=>{const t=e.querySelector('[data-carousell="elements-wrapper"]');let n;e.addEventListener("mouseenter",()=>{n=gsap.to(t,{x:"-=200",ease:"none",duration:3,repeat:-1})}),e.addEventListener("mouseleave",()=>{n&&(n.pause(),n=null)})});